INSERT INTO `disasters` VALUES ('2017-01-01 00:00:00','Hurricane','112-4760','$91.61 billion','Hurricane Maria','Florida and Puerto Rico','After strengthening at a near record pace and affecting multiple islands in the eastern Caribbean Sea, Maria struck Puerto Rico as a high-end Category 4 hurricane, causing catastrophic damage to the US island due to extremely powerful winds and devastating floods. The hurricane also knocked out the entire power grid, triggering a near total island blackout. The lack of aid after the disaster caused a humanitarian crisis, the worst in the US since Hurricane Katrina, which lasted several months and had a dramatic effect on Puerto Rico\'s population. Maria is the third costliest hurricane in history, behind only Katrina and Harvey.'),('2017-01-01 00:00:00','Hurricane','134','$64.76 billion','Hurricane Irma','Florida, South Carolina, Georgia, Puerto Rico','Hurricane Irma ravaged the northern Leeward Islands as an extremely powerful Category 5 hurricane before making landfall in the Florida Keys as a Category 4 hurricane, and in the mainland as a Category 3 hurricane. Irma caused widespread damage in Florida due to high winds and destructive floods. The Florida Keys were hit the hardest, with the vast majority of infrastructure there receiving some degree of damage, and at least 25% receiving major damage. Hurricane Irma also knocked out power to 73.33% of the state, or 7.7 million homes and businesses. Irma is the fifth costliest hurricane of all time.'),('2017-01-01 00:00:00','Hurricane','107','$125.00 billion','Hurricane Harvey','Texas, Louisiana, Alabama','Hurricane Harvey began as a tropical storm in the Caribbean Sea before degenerating into a tropical wave, only to regenerate in the Gulf of Mexico and make landfall in Southwestern Texas as a Category 4 hurricane. Most of the damage from Harvey occurred after it had weakened, due to extreme prolonged rains dropping several feet of water that triggered unprecedented floods in a large swath of Southeastern Texas, with the worst of the flooding occurring in Houston. Hurricane Harvey is widely considered to be the worst flooding disaster in the United States since Hurricane Katrina in 2005, which it tied with as the costliest hurricane in history.'),('2016-01-01 00:00:00','Wildfire','14','$990 Million','2016 Great Smoky Mountains wildfires','Tennessee','Destroyed nearly 2,000 structures; burned nearly 18,000 acres.'),('2016-01-01 00:00:00','Hurricane','49','$15.09 Billion','Hurricane Matthew','Florida, Georgia, The Carolinas',NULL),('2016-01-01 00:00:00','Flood','13',NULL,'2016 Louisiana floods','Louisiana',NULL),('2016-01-01 00:00:00','Flood','23',NULL,'2016 West Virginia flood','West Virginia',NULL),('2016-01-01 00:00:00','Blizzard','55','$500,000,000','January 2016 United States blizzard','Southeast through Mid Atlantic to Northeast','Snowfall totals in excess of two feet (61 cm)'),('2015-01-01 00:00:00','Flood','25','Billions','October 2015 North American storm complex','Carolinas',NULL),('2015-01-01 00:00:00','Flood','20',NULL,'2015 Utah floods','Utah',NULL),('2015-01-01 00:00:00','Wildfire','3','$6–8 billion','Okanogan Complex fire','Okanogan County, Washington','Damage figure includes costs involved in the fighting of the fire.'),('2015-01-01 00:00:00','Flood','46',NULL,'2015 Texas–Oklahoma floods','Texas, Kansas, Oklahoma',NULL),('2014-01-01 00:00:00','Snow storm','24',NULL,'November 2014 North American winter storm','Buffalo, New York, Great Lakes region',NULL),('2014-01-01 00:00:00','Tornado','35','$1 billion','April 2014 tornado outbreak','Nebraska, Louisiana, Oklahoma, Illinois, Florida, North Carolina',NULL),('2014-01-01 00:00:00','Mudflow','43',NULL,'2014 Oso mudslide','Oso, Washington',NULL),('2013-01-01 00:00:00','Cold wave','21',NULL,'Early 2014 North American cold wave','Eastern US',NULL),('2014-01-01 00:00:00','Wildfire','19',NULL,'Yarnell Hill Fire','Yarnell, Arizona',NULL),('2013-01-01 00:00:00','Flood','8','$1.9 billion',