s considered to be the worst disaster in the state\'s history.'),('1816-01-01 00:00:00','Famine (caused by volcano)','Unknown',NULL,'Year Without a Summer',NULL,'Volcanic dust from a massive eruption by Mount Tambora in the Dutch East Indies (present Indonesia) in 1815 led to an abnormally cold summer in 1816 in the northeastern United States and eastern Canada. Cold weather inhibited crops, and frosts and snowstorms killed what did grow, leading to a localized famine.');
