INSERT INTO `us_history_timeline` VALUES ('2001-01-20 00:00:00','First inauguration of George W. Bush: George W. Bush was inaugurated the forty-third President of the United States'),('2001-06-07 00:00:00','The Economic Growth and Tax Relief Reconciliation Act of 2001 was signed into law by President George W. Bush'),('2001-06-11 00:00:00','Timothy McVeigh is executed as an American domestic terrorist for the detonation of a truck bomb in front of the Alfred P. Murrah Federal Building in Oklahoma City on April 19, 1995'),('2001-09-11 00:00:00','September 11 terrorist attacks: Nineteen terrorists hijacked four planes and crashed them into the World Trade Center in New York City, the Pentagon in Arlington County, Virginia, and an open field near Shanksville, Pennsylvania, killing 2,996 people and injuring over 6,000. Flight 93 was about to make a crash in Washington, D.C., but the passengers fought the terrorists until the plane crashed into the field'),('2001-09-18 00:00:00','2001 Anthrax attacks: Anthrax attacks killed five and infected seventeen more through the mail system'),('2001-10-07 00:00:00','War in Afghanistan: The United States launched an invasion of Afghanistan'),('2001-10-26 00:00:00','The USA PATRIOT Act, increasing law enforcement agencies\' ability to conduct searches in cases of suspected terrorism, was signed into law'),('2001-11-12 00:00:00','American Airlines Flight 587: A flight crashed in Queens, New York, killing 265'),('2002-06-13 00:00:00','The United States officially withdraws from the Anti-Ballistic Missile Treaty'),('2002-01-08 00:00:00','The No Child Left Behind Act education reform bill was signed into law'),('2002-10-02 00:00:00','Beltway sniper attacks: Ten people were killed and three were injured in attacks around the Washington, D.C. area'),('2002-11-25 00:00:00','The United States Department of Homeland Security was created'),('2003-02-01 00:00:00','Space Shuttle Columbia disaster: The Space Shuttle Columbia disintegrated on reentry into the Earth\'s atmosphere, killing all seven astronauts aboard'),('2003-02-17 00:00:00','2003 E2 nightclub stampede: A nightclub stampede in Chicago, Illinois killed twenty-one'),('2003-02-20 00:00:00','The Station nightclub fire: A fire caused by pyrotechnics at a nightclub in West Warwick, Rhode Island killed 100 people and injured over 230'),('2003-03-19 00:00:00','Invasion of Iraq: The United States, United Kingdom, Australia and Poland invaded Iraq'),('2003-12-13 00:00:00','Capture of Saddam Hussein: In Iraq, deposed Iraqi President Saddam Hussein was captured by United States special forces'),('2004-02-04 00:00:00','The social networking website Facebook was launched'),('2004-02-04 00:00:00','2004 Atlantic hurricane season: Four deadly and damaging hurricanes impacted Florida, killing a combined one hundred people in the United States and producing over $50 billion in damage'),('2004-11-02 00:00:00','U.S. presidential election, 2004; President George W. Bush was reelected, defeating Democratic Senator John F. Kerry'),('2005-01-20 00:00:00','Second inauguration of George W. Bush: George W. Bush was inaugurated to his second term'),('2005-08-23 00:00:00','Hurricane Katrina: A hurricane devastated the Louisiana, Mississippi, and Alabama coastlines killing at least 1,836 people and causing $81 billion in damage'),('2006-11-07 00:00:00','The Democratic Party regained control of both houses of Congress and gained control of a majority of state governorships'),('2007-01-03 00:00:00','Democrat Nancy Pelosi became the first woman to become Speaker of the U.S. House of Representatives'),('2007-01-10 00:00:00','Iraq War troop surge of 2007: George W. Bush ordered the substantial increase of the number of United States troops in Iraq'),('2007-04-16 00:00:00','Virginia Tech massacre: A South Korean student shot and killed thirty-two other students and professors before killing himself'),('2007-08-01 00:00:00','The I-35W Mississippi River bridge in Minneapolis, Minnesota collapsed, killing thirteen people'),('2007-12-01 00:00:00','Great Recession: A recession began'),('2008-02-05 00:00:00','2008 Super Tuesday tornado outbreak: An outbreak of tornadoes killed over sixty people and produced $1 billion in damage across Arkansas, Kentucky, Tennessee, and Alabama'),('2008-02-05 00:00:00','Hurricane Ike: A hurricane killed 100 people along the Texas coast, producing $31 billion in damage and contributing to rising oil prices'),('2008-07-11 00:00:00','Oil prices in the United States hit a record $147 per barrel'),('2008-07-11 00:00:00','Global financial crisis in September 2008: The stock market crashed'),('2008-09-14 00:00:00','Bankruptcy of Lehman Brothers: Investment bank Lehman Brothers files for bankruptcy, the largest in U.S. history'),('2008-11-04 00:00:00','U.S. presidential election, 2008: Barack Obama was elected the forty-fourth President of the United States'),('2009-01-20 00:00:00','Inauguration of Barack Obama: Obama was inaugurated the forty-fourth President of the United States'),('2009-02-17 00:00:00','President Barack Obama signed the American Recovery and Reinvestment Act of 2009, a $787 billion economic stimulus package'),('2009-02-17 00:00:00','Tea Party protests: The first of a series of protests, focusing on smaller government, fiscal responsibility, individual freedoms and conservative views of the Constitution, were conducted across the country'),('2009-06-25 00:00:00','Death of Michael Jackson: Pop icon Michael Jackson died'),('2009-08-08 00:00:00','Sonia Sotomayor was sworn in as an Associate Justice of the Supreme Court; becoming the first Latina Justice'),('2009-11-05 00:00:00','Fort Hood shooting: Nidal Malik Hasan killed twelve servicemen and injured thirty-one'),('2010-02-23 00:00:00','The United States Navy lifted its ban on women in submarines'),('2010-03-23 00:00:00','The Patient Protection and Affordable Care Act (PPACA) was signed into law by President Barack Obama'),('2010-04-20 00:00:00','Deepwater Horizon oil spill: The BP oil rig Deepwater Horizon exploded in the Gulf of Mexico, killing 11 workers and spilling 4.9 million barrels of oil into the Gulf over an 87-day period; being the largest marine oil spill in the history of the petroleum industry'),('2010-07-21 00:00:00','The Dodd-Frank Wall Street Reform and Consumer Protection Act was signed into law; establishing the Consumer Financial Protection Bureau'),('2010-11-02 00:00:00','United States Senate elections, 2010: The Republican Party gained five seats, to forty-seven, reducing the Democratic presence in the Senate to fifty-one. Two seats remained in the hands of independents'),('2010-11-02 00:00:00','United States House of Representatives elections, 2010: The Republican Party gained sixty-two seats, giving them an absolute majority of 242 in the House and reducing the Democratic presence to 193'),('2010-11-28 00:00:00','United States diplomatic cables leak: WikiLeaks began to release classified diplomatic documents to the international press'),('2010-12-22 00:00:00','The Senate ratified the New START treaty'),('2010-12-22 00:00:00','The Don\'t Ask, Don\'t Tell Repeal Act of 2010 was signed into law, ending the Don\'t ask, don\'t tell policy regarding homosexuals in the United States Armed Forces'),('2011-01-08 00:00:00','2011 Tucson shooting: A gunman targeting Democratic Representative Gabrielle Giffords critically injured Giffords and killed six others, including federal judge John Roll, in Tucson, Arizona'),('2011-03-19 00:00:00','Operation Odyssey Dawn: The United States began air and cruise missile attacks against Libya'),('2011-04-25 00:00:00','2011 Super Outbreak: The largest tornado outbreak ever in United States history occurs in the American Midwest and Southern United States killing 348 people and causing $11 billion in damage'),('2011-05-02 00:00:00','Death of Osama bin Laden: Al-Qaeda head Osama bin Laden was killed by United States forces in Abbottabad, Pakistan'),('2011-05-22 00:00:00','Joplin Tornado: An EF-5 tornado tore through Joplin, Missouri, killing 161, and causing $2.8 billion in damage, including the destruction of a large portion of the main retail strip, a hospital, the high school, a middle school, and several elementary schools'),('2011-08-02 00:00:00','United States debt-ceiling crisis: The Budget Control Act of 2011 was signed into law, increasing the legal limit on federal government debt in order to prevent default and establishing the United States Congress Joint Select Committee on Deficit Reduction'),('2011-08-05 00:00:00','United States federal government credit-rating downgrade, 2011: The credit-rating arm of Standard & Poor\'s reduced the rating of United States federal government debt from AAA to AA+'),('2011-08-08 00:00:00','August 2011 stock markets fall: Major United States stock market indices dropped in value by some two and a half trillion dollars'),('2011-09-17 00:00:00','The populist Occupy Wall Street protest movement made camp in Zuccotti Park in New York City'),('2011-12-18 00:00:00','Withdrawal of U.S. troops from Iraq: The last United States troops withdrew from Iraq under the terms of the U.S.–Iraq Status of Forces Agreement'),('2012-07-20 00:00:00','2012 Aurora shooting: occurs inside of a Century 6 movie theatre in Aurora, Colorado killing 12 people and injuring 70 others, the largest number of casualties in one shooting on U.S. soil until the Orlando nightclub shooting four years later'),('2012-09-11 00:00:00','2012 Benghazi attack: An attack that was coordinated against two United States government facilities in Benghazi, Libya by members of the Islamic militant group Ansar al-Sharia'),('2012-09-11 00:00:00','Hurricane Sandy: A devastating hurricane wreaks havoc for the Eastern United States coast. There were many states severely impacted by the hurricane, especially New York and New Jersey, which took a direct hit from the storm'),('2012-11-06 00:00:00','United States presidential election, 2012: Barack Obama is reelected as president'),('2012-12-14 00:00:00','Sandy Hook Elementary School shooting: Occurs in Newtown, Connecticut killing 20 Children and 6 Staff Members in Sandy Hook Elementary School, perpetrated by a 20 Year Old, Adam Lanza'),('2013-01-20 00:00:00','Barack Obama is inaugurated for his second term as president'),('2013-04-15 00:00:00','Boston Marathon bombing: Two pressure cooker bombs explode during the Boston Marathon'),('2013-04-15 00:00:00','Global surveillance disclosures: The revelations of the NSA\'s PRISM, Boundless Informant and XKeyscore domestic surveillance programs were first published by The Guardian and Washington Post newspapers'),('2014-04-16 00:00:00','Malaysia Airlines Flight 370: Flight MH370 of Malaysian airlines went missing and hasn\'t been seen since. Despite search efforts from the US and the rest of the world. 3 American citizens was on-board this flight'),('2014-05-23 00:00:00','2014 Isla Vista killings occurs, killing 6, and wounding 14 others, perpetrated by Elliot Rodger'),('2014-05-23 00:00:00','President Obama orders the return of a small number of troops to Iraq to help bolster Iraqi and Kurdish military forces in their war with the Islamic State of Iraq and the Levant'),('2014-08-09 00:00:00','Michael Brown was shot and killed, in what was ruled by a grand jury to be self-defense, by police officer Darren Wilson in Ferguson, Missouri, igniting protests and riots in the following months'),('2014-11-03 00:00:00','New building, 1 World Trade Center, opens in New York City'),('2014-11-04 00:00:00','In national elections, Republicans take control of the U.S. Senate and maintaining a majority in the House of Representatives'),('2014-12-17 00:00:00','President Obama announces a restoration of full diplomatic relations with Cuba for the first time since 1961'),('2015-04-27 00:00:00','2015 Baltimore protests: Protests and rioting occur in Baltimore, Maryland after the death of Freddie Gray in police custody'),('2015-06-17 00:00:00','Charleston church shooting: A gunman killed 9, including a state senator in a church in Charleston, South Carolina'),('2015-06-26 00:00:00','Obergefell v. Hodges: Same-sex marriage is fully legalized in all 50 states'),('2015-07-20 00:00:00','Restoration of relations with Cuba'),('2015-12-02 00:00:00','2015 San Bernardino attack: Rizwan Farook and Tashfeen Malik, a married radical Muslim couple, kills 14 people at a center for the developmentally disabled'),('2016-06-11 00:00:00','2016 Orlando Nightclub Shooting: A self-proclaimed Islamic State fighter, Omar Mateen, kills 49 and injures 53 at a gay nightclub in Orlando, before being shot and killed by an officer'),('2016-07-07 00:00:00','2016 shooting of Dallas police officers: Micah Xavier Johnson ambushed and fired upon a group of police officers in Dallas, Texas, killing five officers and injuring nine others. Two civilians were also wounded. Johnson was an Army Reserve Afghan War veteran who was reportedly angry over police shootings of black men and stated that he wanted to kill white people, especially white police officers. The shooting happened at the end of a peaceful protest against police killings of Alton Sterling in Baton Rouge, Louisiana, and Philando Castile in Falcon Heights, Minnesota, which had occurred in the preceding days'),('2016-08-12 00:00:00','2016 Louisiana floods: Prolonged rainfall in southern parts of the U.S. state of Louisiana resulted in catastrophic flooding that submerged thousands of houses and businesses. Louisiana\'s governor, John Bel Edwards, called the disaster a \"historic, unprecedented flooding event\" and declared a state of emergency'),('2016-08-13 00:00:00','2016 Milwaukee riots: A riot began in Milwaukee, Wisconsin, sparked by the fatal police shooting of 23-year-old Sylville Smith. During the three-day turmoil, several people, including police officers, were injured and dozens of protesters arrested'),('2016-11-08 00:00:00','United States presidential election, 2016: Donald Trump wins the 2016 presidential election, and becomes the forty-fifth president of the United States.[742] The Republicans also regained the majority of both the House and Senate; an election in which the Republican candidate wins the election while the majority in Congress maintains a Republican control hasn\'t happened since 2004'),('2017-01-20 00:00:00','Inauguration of Donald Trump: Donald Trump is inaugurated as the forty-fifth president of the United States'),('2017-10-01 00:00:00','The 2017 Las Vegas shooting in Las Vegas, Nevada, happened when Stephen Paddock opened fire into the crowd, and killed 58, as well as injuring 851 more, and became the deadliest mass shooting in modern U.S. history'),('2017-12-22 00:00:00','The Tax Cuts and Jobs Act of 2017 is signed into law, lowering income tax rates and the corporate tax rate'),('2018-01-13 00:00:00','The Hawaii Emergency Management Agency announced a missile attack could take place, resulting in Hawaii\'s citizens panicking'),('2018-01-23 00:00:00','An 8.0-magnitude earthquake took place near the southern coast of Alaska'),('2018-02-04 00:00:00','The Philadelphia Eagles claim victory in the Super Bowl for the first time'),('2018-02-14 00:00:00','A school shooting took place at Marjory Stoneman Douglas High School in Parkland, Florida, claiming the lives of 17 students');
